                    <h4 class="bigtitle">ABOUT ME</h4>
                    <h5 class="intro">Hey there!<br>I am Samuel, welcome to my website :)<br>On this page, you will find information about my person, my interests, and my background. This page is pretty much a spare time project to connect with the world, increase chances of meeting interesting people, share information, and, of course, trying out exciting technologies. I seek always for opportunities to expand my horizon and keep up to date with technological enhancements. You may already have noticed that I love technology, particularly computer science. Concepts such as morality and ethics are also highly relevant to me. Conversely, money or material possessions do not have a substantial priority in my world. I believe that the preponderance of desirable things in life is available (almost) for free. This realization came up quite late in my life, but it triggered a trajectory to see the world from a completely different perspective. This is my journey, feel free to message me through the contact form for further information, collaboration, or whatever is on your mind. I will reply to messages for sure! The subsequent lines give a little inside of how my recent education looked like. However, autodidacticism is pretty appealing to me, especially owing to our era of free accessible information for everybody. Basically, the majority of my practical knowledge originates from this paradigm. Moreover, I consider this approach as one with maximal self-responsibility and determination.<br>Best regards,<br>SAMUEL BLEHM</h5>
                    <div class="bottomBorder"></div>
