                    <h4 class="bigtitle popUpTitle">PROJECTS</h4>
                    <h5 class="intro">In this section, I wish to tell you more about projects I worked on and still work. I communicate a few insights regarding the frameworks and the programming languages I apply/applied. By hovering over the screens in the "PROJECTS" section, an information text appears -in case your device is not too small. There is also a link to the according GitHub code, make no bones about to visit and download the code. On my GitHub-account, you can see virtually all major projects in which I was and I am still involved. There are a few on top of that though not worth mentioning. The first line of code which I wrote was in late 2011 when I enrolled as a freshman for Business Informatics in Mannheim. This was the first time I touched serious code in my life. Unfortunately, I had a tough time in the beginning, which consequently resulted in frustration rather than pleasure. Anyhow, it turned out that I appreciate writing programs as I had to carry out a vast software project in a team. The result is the NAO-Web application. Nevertheless, I had little time to code since the schedule in university was quite tight. In university, I gathered foundational knowledge in math, theoretical computer science and Java as a first programming language. In my later studies, I did a "C" course provided by Prof. Dr.-Ing. Wolfgang Effelsberg. I followed the tutorials and exercises voluntarily in order to understand the language and obtain an idea about pointers and memory allocation. For further information, read the following lines which contain detailed project information.</h5>
                    <div class="bottomBorder"></div>
                    <h4 class="bigtitle">NAO WEB APPLICATION</h4>
                    <h5 class="subtitle">OVERVIEW:</h5>
                    <div class="subsection">
                        <li class="init">DESIGNING AND IMPLEMENTING A REMOTE CONTROL FROM SCRATCH WHICH STEERS THE ROBOT THROUGH A WEB APPLICATION</li>
                        <li class="space indentli">Distributed team out of five people</li>
                        <li class="space indentli">Every individual developed certain functionalities</li>
                        <li class="space indentli">Crafting Use-Cases, UML Diagrams, System Sequence Diagrams, Domain Model and more.</li>
                        <li class="init">FUNCTIONALITY</li>
                        <li class="space indentli">WiFi-Connection.</li>
                        <li class="space indentli">Activity display.</li>
                        <li class="space indentli">In Browser video transmission.</li>
                        <li class="space indentli">Simple motion activities, like moving extremities. </li>
                        <li class="space indentli">Text to speech functionality. </li>
                        <li class="space indentli">Complex tasks such as running in a rectangular field without leaving. </li>
                        <li class="space indentli">Walking to an arbitrary target defined by the user in the browser. </li>
                        <li class="space indentli">Detecting geometric objects. </li>
                        <li class="space indentli">Taking the role of a hunter which hunts another robot. </li>
                        <li class="space indentli">Taking the role of a hunted robot which flees from a hunter. </li>
                        <li class="space indentli">Drag and drop functionality for assigning a sequence of tasks.</li>
                        <li class="init">TOOLS</li>
                        <li class="space indentli">Java / HTML / CSS / XML - Eclipse</li>
                        <li class="space indentli">Google Web Toolkit</li>
                        <li class="space indentli">Mercurial as a distributed source control management tool</li>
                        <li class="space indentli">Modelio for creating the class diagram</li>
                        <li class="space indentli">Visual Paradigm for the UML Diagram</li>
                        <li class="space indentli">Papyrus for the System Sequence Diagrams</li>
                        <li class="space indentli">Microsoft Visio for several graphics</li>
                        <li class="init">ARCHITECTURE</li>
                        <li class="space indentli">Asynchronous Client-Server Model</li>
                        <li class="space indentli">Client-Server communication via RPCs</li>
