                    <h5 class="subtitle">OVERVIEW:</h5>
                    <div class="subsection">
                        <li class="init makespace">While I attended Mannheim University, I worked at the Chair of Information Systems IV. The chair focused on enterprise systems. One of my tasks was the IT Administration of a team project conducted by master students in business informatics. The project was carried out in SAP NetWeaver. I managed the access rights management of the students. Prior to that, I collected experience in a four-day training conducted by "SAP-Arbeitsgemeinschaft Controlling & Financials" at the University of Mannheim. In this exercise, we covered SAP ERP, SAP CO, SAP BW, and SAP BCS.</li>
