                    <h5 class="subtitle">OVERVIEW:</h5>
                    <div class="subsection">
                        <li class="init makespace">I faced SPSS also during my time at the University of Mannheim. I attended a voluntary workshop which conveyed fundamental information about the user interface, data manipulation and graphical output by applying statistical measures.</li>
                    </div>
