                    <h5 class="subtitle">OVERVIEW:</h5>
                    <div class="subsection">
                        <li class="init makespace">Working with the Microsoft Office suite started a while ago. Fundamental practice in Word, Excel, Access, and Outlook has been an element of a vocational training I realized successfully a while ago. Using these tools on a regular basis had been necessary ever since. During my studies, LATEX served also as a further document creation tool.</li>
                    </div>
