                    <h5 class="subtitle">OVERVIEW:</h5>
                    <div class="subsection">
                        <li class="init makespace">The version control system "Git" served and still serves me for developing fresh software ideas and merging them to the master branch. So far I only had once the opportunity to exploit the immense potential of such a system. During a team project, five people worked individually on the project code. A version control system facilitates work coordination and synchronization tremendously. A sophisticated Git GUI Client came recently out. Make sure to give it a shot.</li><a href="https://www.gitkraken.com/">GitKraken</a>
                    </div>
